import React from 'react';



const Footer = () => {
    return (
        <>
            <div className='footer_elm my-3'>
                <div className='container-fluid nav_bg'>
                    <div className='row'>
                        <div className='col-10 mx-auto'>
                            <div>
                                <p>The Association of Civil Engineers, B.I.T. Sindri established in 2017 is an assortment of individuals who aim to acquaint you with the latest trends in the Civil Engineering field.</p><i className="fa fa-spinner ">no spinner but why</i>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Footer;
